import React from "react";
import {AncmntAutoForm} from "./AncmntAutoForm";


export const AncmntAutoFormContainer = (props) => {
    const {
        t,
        activeStep,
        locations,
        ancmntType,
        createAncmnt,
        values,
        setValues,
        touched,
        setTouched,
        errors,
        handleTime,
        handleBlur,
        handleSwitch,
        handleWeekDay,
        handleMenuItem,
        handleListItem,
        handleInput,
        handleAuctionInput,
        handleParamsCheckbox,
        handleCheckboxChange,
    } = props;


    return (
        <AncmntAutoForm
            {...props}
            errors={errors}
            touched={touched}
            setTouched={setTouched}
            values={values}
            setValues={setValues}
            locations={locations}
            handleBlur={handleBlur}
            handleTime={handleTime}
            handleInput={handleInput}
            handleSwitch={handleSwitch}
            handleWeekDay={handleWeekDay}
            handleListItem={handleListItem}
            handleMenuItem={handleMenuItem}
            handleParamsCheckbox={handleParamsCheckbox}
            handleCheckboxChange={handleCheckboxChange}
        />
    )
};
